    }

    return (
        <div className="app">
            <div className="p-10">
                <AccountForm title={"Home"} content={<Content state={state}/>}/>
            </div>
        </div>
    )
};

const EventCard = ({ title, content }) => {
    return(
        <div className = "event-card-container">
            <div className = "event-card-title">{title}</div>
            <div className = "event-card-content">{content}</div>
        </div>
    )
}

export default Home;
